import React, { Component } from 'react'

export class Serch extends Component {
    state ={
        search : "salam"
    }

    hand = (e) => {
        this.setState({
            search : e.target.value
        })
    }
    render() {

        const { search }=this.state;
        return ( 

            <div>
                <form>
                    <div className="form-group">


                        <input value={search} onChange={this.hand} id="search" type="text"/>
                        <button type="button" class="btn btn-outline-primary">seach</button>
                        {search}
                    </div>

                </form>
            </div>
        )
    }
}

export default Serch
